import 'dart:convert';List<GetImages> welcomeFromJson(String str) => List<GetImages>.from(json.decode(str).map((x) => GetImages.fromJson(x)));String welcomeToJson(List<GetImages> data) => json.encode(List<dynamic>.from(data.map((x) => x.toJson())));class GetImages {  GetImages({    this.userId,    this.id,    this.title,  });  int userId;  int id;  String title;  factory GetImages.fromJson(Map<String, dynamic> json) => GetImages(    userId: json["userId"],    id: json["id"],    title: json["title"],  );  Map<String, dynamic> toJson() => {    "userId": userId,    "id": id,    "title": title,  };}